    center: {
      lat: 10.99835602,
      lng: 77.01502627
    },
    zoom: 11
  };
    return (
        <div id="sidebar" style={{color: 'red'}}>
          <h1>React Map Contacts</h1>
          <GoogleMapReact
        bootstrapURLKeys={{ key: "" }}
        defaultCenter={defaultProps.center}
        defaultZoom={defaultProps.zoom}
      >
      </GoogleMapReact>
        </div>
    );
  }
